import React, { useState }  from 'react';   
import { ImageView } from '../../components/imageView';  
import { ArrayBox } from './source';

// styles
import './quiz.scss';

interface QuizProps {  }

const Quiz: React.FC<QuizProps> = () => { 

  return (
    <div className='pg-quiz'>  
      <h1>QUIZ</h1> 
      <div className='quiz-container-box'>   
        { ArrayBox.map( (item) => 
            item.view
              ?<ImageView imageCard={item.image} nameCard={item.name}  className={item.name}/>  
              :<ImageView imageCard='quiz/box.png' nameCard='box'  className='box'/>  
          )
        }
      </div>
    </div>
  );
};


export default React.memo(Quiz);
